        return (b + a) * (b - a + 1) // 2

    def factorize(n):
        if n < 4:
            return [1, n]
        res = [1]
        i = 2
        while i ** 2 <= n:
            if n % i == 0:
                res.append(i)
                m = n // i
                if i != m:
                    res.append(m)
            i += 1
        res.append(n)
        return res
    if S == 1:
        return 1
    factors = factorize(S)
    f = defaultdict(lambda : 0)
    p = defaultdict(lambda : 1)
    factors.sort()
    for k in factors:
        for a in range(1, k + 1):
            b = k - a
            if a <= b:
                if p[a, b]:
                    f[sum_range(a, b)] += 1
                    p[a, b] = 0
        for a in range(1, S + 1):
            b = (k + a) * 1
            if p[a, b]:
                s_ = sum_range(a, b)
                if s_ > S:
                    break
                f[s_] += 1
                p[a, b] = 0
    ans = 0
    for k in factors:
        ans += f[k] * f[S // k]
    return ans

